@kaerbear Let me reiterate my point. If a man commits a reprehensible act, it is regarded as a result of toxic masculinity, but¬†If a women commits that same offense, I rarely see the words toxic femininity get thrown around. (at least, not to the same extent)

Now let me talk about the words toxic masculinity themselves. The first word 'toxic' has a blatantly obvious negative connotation attached to it and it is also a pronoun. If you've ever been to an English class you would know that a pronoun is used to describe the noun that comes after it. So what's the second half of this term? 'Masculinity', which has such a broad meaning that I sometimes wonder what's the point of using it. Now from an outsider's perspective, you can't blame someone for misunderstanding what this term means, because the immediate meaning you derive from it is "masculinity is toxic". Now you could go around trying to explain to people what it really means, but what I'm trying to get you to understand is that *using the word toxic masculinity will have a negative impact on the minds of men in the long run*. I think the word 'toxic masculinity' can easily be used to oppress members in a society (men) and get them to feel like there is something inherently wrong with them, and that will destroy their self-image and confidence. Perhaps this is what feminists want in the first place ie. to get the word toxic masculinity into the mainstream vocabulary, after which it's constant usage will create self-doubt and guilt in the minds of men. You keep saying that you shouldn't associate sensitivity to femininity, but you are doing the exact same thing by insisting on using the words toxic masculinity. The truth is that if you use a word with a negative connotation (toxic) along with a word that doesn't have one (masculinity), you can eventually get people to attach the negative connotation of the former to the latter in their minds. So you're being a hypocrite by using the term toxic masculinity.

Here's my advice, if you don't want  people to get turned off by your cause, come up with a better terminology than toxic masculinity.

